import React from 'react'
import { useSelector } from 'react-redux';
import { RouteObject, useRoutes } from 'react-router-dom';
import { RouteObjects } from '../Router/RouteObject';
import Loader from './Loader';

function LoaderStatus() {
    let routes: RouteObject[] = [
      {
        path: "/",
        element: <PublicLayOut />,
        children: [
          { index: true, element: <Login /> },
          {
            path: "/Registration",
            element: <Registration />
          },
    
          {
            path: "/Login",
            element: <Login />
          }
        ]
      },
      { path: "*", element: <p>There's nothing here!</p> },
      {
        path: "/Task", element:( RequireAuth(<TaskShow />))
      }
    ];
    let element = useRoutes(routes);
    const LoaderState = useSelector((state:any) => state.LoaderReducer);
console.log(LoaderState)
  return (
    <>
   {  LoaderState==true?<Loader/>:element}
    </>
  )
}

export default LoaderStatus
